import React from 'react';
import ReactDOM from 'react-dom';
import './chatbox.css';

const ChatPop = (props) => {

    let d = new Date();

    let doc = new DOMParser().parseFromString(props.text, "text/xml");

    return(
        <div className = {`containerchat ${props.dark}`}>
            <img src={props.imgsrc} alt="Avatar" className={props.just}/>
            <h3 style={{marginLeft:"20px"}}>{doc}</h3>
            <span className="time-right">{`${d.getHours()}:${d.getMinutes()}:${d.getSeconds()}`}</span>
        </div>
    );
};

export default ChatPop;
